(New Latin) Alternative spelling of porrō
1687, E. Leichneri Gymnasiosophia, h. e. viva Idea Gymnasii, by Eckhard Leichner
E didacticis porrò 6. memor, quod praeter Lingvisticas (Vocabularias) et Historicas, vix ulla detur Lectio, quae non, prius et plus a iudicio eiusq[ue] solidatione, quam a memoriá pendeat, adeoque verbotim ediscendi & memoriter hinc recitandi torturam per se respuat: imprimis hoc verum esse recordetur de Disciplina, quae in totum est iudicii, hucusque informatrix et directrix;

uranographic, of or pertaining to uranography, celestial cartography
1744, Nova acta eruditorum anno 1744 publicarum, p. 54
Claudunt tandem agmen harum elegantissimarum Tabularum uranographicarum duae, quae ad Astronomiam comparativam pertinent{...}
Finally, two of these quite elegant uranographic tables which pertain to comparative astronomy close the column{...}
